import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Nav from './components/navbar/nav';
import Cards from './components/cards/cards';
import Router from './routes/routes';

function App() {
  return (
    <div>
      <Nav />
      <Router />
      <Cards />
    </div>
  );
}

export default App;
